            justify-content: center;
            align-items: center;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 100;

            font-size: 28px;
            color: white;
            font-weight: bold;
            letter-spacing: 1px;

            overflow: hidden;
            cursor: grab;
            transition: transform 0.1s ease;

            cursor: grabbing;

            background-size: cover;
            background-position: center 70%;
            display: flex;
            flex-direction: column;
            justify-content: flex-end;
            padding: 20px;
        }

        .profile-name {
            color: white;
            font-size: 28px;
            font-weight: bold;
            text-shadow: 2px 2px 10px rgba(0,0,0,0.5);
        }

        .profile-location {
            color: rgba(255,255,255,0.9);
            font-size: 15px;
            margin-top: 5px;
            display: flex;
            align-items: center;
            gap: 5px;
        }

        .card-bio {
            padding: 15px 20px;
            background: white;
            height: 28%;
        }

        .bio-text {
            font-size: 16px;
            color: #333;
            line-height: 1.4;
            margin-bottom: 10px;
        }

        .looking-for {
            padding: 10px 12px;
            background: linear-gradient(90deg, #fd297b22, #ff586422);
            border-radius: 10px;
            display: flex;
            align-items: center;
            gap: 8px;
        }

        .looking-for span {
            font-size: 14px;
            color: #ff5864;
            font-weight: 600;
        }

        .buttons {
            position: fixed;
            bottom: 25px;
            left: 0;
            right: 0;
            display: flex;
            justify-content: center;
            gap: 20px;
            z-index: 100;
        }

        .btn {
            width: 60px;
            height: 60px;
            border-radius: 50%;
            border: none;
            cursor: pointer;
            display: flex;
            justify-content: center;
            align-items: center;
            font-size: 26px;
            transition: all 0.2s ease;
            box-shadow: 0 4px 15px rgba(0,0,0,0.2);
        }

        .btn:hover {
            transform: scale(1.1);
        }

        .btn-nope {
            background: white;
            border: 3px solid #ff6b6b;
        }

        .btn-like {
            background: white;
            border: 3px solid #4ade80;
        }

        .btn-superlike {
            background: white;
            border: 3px solid #38bdf8;
            width: 45px;
            height: 45px;
            font-size: 20px;
        }

        .swipe-indicator {
            position: absolute;
            top: 50px;
            padding: 10px 20px;
            border-radius: 5px;
            font-size: 32px;
            font-weight: bold;
            border: 4px solid;
            opacity: 0;
            transition: opacity 0.2s ease;
        }

        .like-indicator {
            right: 20px;
            color: #4ade80;
            border-color: #4ade80;
            transform: rotate(-20deg);
        }

        .nope-indicator {
            left: 20px;
            color: #ff6b6b;
            border-color: #ff6b6b;
            transform: rotate(20deg);
        }

        .match-screen {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: linear-gradient(135deg, #fd297b, #ff5864, #ff655b);
            display: none;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            z-index: 1000;
            padding: 20px;
            overflow-y: auto;
        }

        .match-screen.active {
            display: flex;
            animation: fade-in 0.5s ease;
        }

        @keyframes fade-in {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        .match-text {
            font-size: 38px;
            color: white;
            font-weight: bold;
            text-shadow: 2px 2px 20px rgba(0,0,0,0.3);
            animation: pulse-match 1s ease-in-out infinite;
            margin-bottom: 10px;
        }

        @keyframes pulse-match {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        .match-subtitle {
            font-size: 16px;
            color: rgba(255,255,255,0.9);
            margin-bottom: 20px;
            text-align: center;
        }

        .match-profiles {
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 15px;
            margin-bottom: 15px;
        }

        .match-avatar {
            width: 110px;
            height: 110px;
            border-radius: 50%;
            border: 4px solid white;
            background-size: cover;
            background-position: center;
            box-shadow: 0 10px 30px rgba(0,0,0,0.3);
        }

            border-radius: 15px;

            font-size: 16px;
            color: #ff5864;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            text-decoration: none;

            margin-top: 10px;

        .match-message:hover {
            transform: scale(1.05);
            box-shadow: 0 10px 30px rgba(0,0,0,0.2);
        }

        .confetti {
            position: fixed;
            width: 10px;
            height: 10px;
            top: -20px;
            animation: confetti-fall 3s linear forwards;
            z-index: 1001;
        }

        @keyframes confetti-fall {
            to {
                transform: translateY(100vh) rotate(720deg);
                opacity: 0;
            }
        }

        @keyframes nope-shake {
            0%, 100% { transform: translateX(0); }
            25% { transform: translateX(-20px) rotate(-5deg); }
            75% { transform: translateX(20px) rotate(5deg); }
        }

        .card.nope-shake {
            animation: nope-shake 0.5s ease;
        }

        @keyframes fly-right {
            to {
                transform: translateX(150%) rotate(30deg);
                opacity: 0;
            }
        }

        .card.fly-right {
            animation: fly-right 0.5s ease forwards;
        }
    </style>

    </div>

    <script>
        const card = document.getElementById('card');
        const likeIndicator = document.getElementById('likeIndicator');
        const nopeIndicator = document.getElementById('nopeIndicator');
        const matchScreen = document.getElementById('matchScreen');
        
        let startX = 0;
        let currentX = 0;
        let isDragging = false;
        let nopeCount = 0;

        card.addEventListener('mousedown', startDrag);
        card.addEventListener('touchstart', startDrag);
        document.addEventListener('mousemove', drag);
        document.addEventListener('touchmove', drag);
        document.addEventListener('mouseup', endDrag);
        document.addEventListener('touchend', endDrag);

        function startDrag(e) {
            isDragging = true;
            startX = e.type === 'mousedown' ? e.clientX : e.touches[0].clientX;
            card.style.transition = 'none';
        }

        function drag(e) {
            if (!isDragging) return;
            e.preventDefault();
            
            currentX = e.type === 'mousemove' ? e.clientX : e.touches[0].clientX;
            const diff = currentX - startX;
            const rotation = diff * 0.1;
            
            card.style.transform = `translateX(${diff}px) rotate(${rotation}deg)`;
            
            if (diff > 50) {
                likeIndicator.style.opacity = Math.min((diff - 50) / 100, 1);
                nopeIndicator.style.opacity = 0;
            } else if (diff < -50) {
                nopeIndicator.style.opacity = Math.min((-diff - 50) / 100, 1);
                likeIndicator.style.opacity = 0;
            } else {
                likeIndicator.style.opacity = 0;
                nopeIndicator.style.opacity = 0;
            }
        }

        function endDrag(e) {
            if (!isDragging) return;
            isDragging = false;
            
            card.style.transition = 'transform 0.3s ease';
            const diff = currentX - startX;
            
            if (diff > 100) {
                handleLike();
            } else if (diff < -100) {
                handleNope();
            } else {
                card.style.transform = 'translateX(0) rotate(0)';
                likeIndicator.style.opacity = 0;
                nopeIndicator.style.opacity = 0;
            }
        }

        function handleLike() {
            card.classList.add('fly-right');
            likeIndicator.style.opacity = 1;
            
            setTimeout(() => {
                showMatch();
            }, 500);
        }

        function handleNope() {
            nopeCount++;
            
            card.classList.add('nope-shake');
            nopeIndicator.style.opacity = 1;
            
            setTimeout(() => {
                card.classList.remove('nope-shake');
                card.style.transform = 'translateX(0) rotate(0)';
                nopeIndicator.style.opacity = 0;
            }, 500);

            const nopeBtn = document.getElementById('nopeBtn');
            if (nopeCount === 1) {
                nopeBtn.innerHTML = 'ðŸ¥º';
            } else if (nopeCount === 2) {
                nopeBtn.innerHTML = 'ðŸ˜¢';
            } else if (nopeCount >= 3) {
                nopeBtn.innerHTML = 'ðŸ˜­';
                nopeBtn.onclick = handleLike;
            }
        }

        function showMatch() {
            matchScreen.classList.add('active');
            createConfetti();
        }

        function createConfetti() {
            const colors = ['#ff6b6b', '#ffd93d', '#6bcb77', '#4d96ff', '#ff6eb4', '#fff'];
            
            for (let i = 0; i < 150; i++) {
                setTimeout(() => {
                    const confetti = document.createElement('div');
                    confetti.className = 'confetti';
                    confetti.style.left = Math.random() * 100 + 'vw';
                    confetti.style.backgroundColor = colors[Math.floor(Math.random() * colors.length)];
                    confetti.style.borderRadius = Math.random() > 0.5 ? '50%' : '0';
                    confetti.style.width = (Math.random() * 10 + 5) + 'px';
                    confetti.style.height = (Math.random() * 10 + 5) + 'px';
                    confetti.style.animationDuration = (Math.random() * 2 + 2) + 's';
                    document.body.appendChild(confetti);
                    
                    setTimeout(() => confetti.remove(), 4000);
                }, i * 20);
            }
        }

        
    </script>
</body>
</html>
